import ClientPanel from "../pages/ClientPanel";
import AbcientPage from "../pages/AbcientPage";
import Footer from "./Footer";
import {Outlet} from "react-router-dom";
import Header from "./Header";
import axios from "axios";
import {useContext, useState} from "react";
import {UserId} from "../App";
function Main(){
    const teacherId = useContext(UserId);
    const [className, setClassName] = useState("sdsdcd");
    const [username, setUsername] = useState("Кирилл");

    return(
        <div className="Main">
            <Header classGrad={'99'} nameApp={'Классный помощник'}/>
            <Outlet context={[className, setClassName, username, setUsername]}/>
            <Footer/>
        </div>
    )
}
export default Main;
